To use the library, add this to your Cargo.toml: [dependencies]
iota-wallet = { git = "https://github.com/iotaledger/wallet.rs" } Initialisation In order to use the library you first need to create an AccountManager: use iota_wallet::{ account_manager::AccountManager, client::ClientOptionsBuilder, signing::SignerType, storage::sqlite::SqliteStorageAdapter,
};
use std::path::PathBuf; #[tokio::main]
async fn main() -> iota_wallet::Result<()> { let storage_folder: PathBuf = "./my-db".into(); let manager = AccountManager::builder() .with_storage(&storage_folder, SqliteStorageAdapter::new(&storage_folder, "accounts")?) .finish() .await?; let client_options = ClientOptionsBuilder::new().with_node("http://api.lb-0.testnet.chrysalis2.com")?.build(); let account = manager .create_account(client_options) .signer_type(SignerType::EnvMnemonic) .initialise() .await?; Ok(())
}

